import logo from "./logo.svg";
import "./App.css";

class App extends Component {
  constructor() {
    super();
    this.state = {
      monsters: [

      ]
    };


  }
  componentDidMount(){
   fetch("https://jsonplaceholder.typicode.com/users").then((response)=>{
    response.json()
    }).then((user)=>{
      this.setState({monster: user})
    })


  } 
  render() {
    return (
      <div className="App">
        {this.state.monsters.map((monster) => {
          return <h1>{monster.name}</h1>;
        })}
      </div>
    );
  }
}

export default App;
